import React from 'react';
 import billieJeanImage from "../assets/images.png";
 import beatItImage from "../assets/images.png";
 import smoothCriminalImage from "../assets/images.png";
import dontStopImage from "../assets/images.png";
import rockWithYouImage from "../assets/images.png" ;

const SongTable = ({ onSongClick }) => {
  const songs = [
    {
        id: 1,
        title: 'Billie Jean',
        plays: '1,040,814,084',
        time: '4:53',
        album: 'Thriller 25',
        image: billieJeanImage,
        url: "https://gaana.com/song/agar-tum-saath-ho", // Use imported image
      },
      {
        id: 2,
        title: 'Beat It',
        plays: '643,786,045',
        time: '4:18',
        album: 'Thriller 25',
        image: beatItImage,
      },
      {
        id: 3,
        title: 'Smooth Criminal',
        plays: '407,234,004',
        time: '4:17',
        album: 'Thriller 25',
        image: smoothCriminalImage,
      },
      {
        id: 4,
        title: "Don't Stop 'Til You Get Enough",
        plays: '316,391,952',
        time: '6:05',
        album: 'Bad 25th Anniversary',
        image: dontStopImage,
      },
      {
        id: 5,
        title: 'Rock With You',
        plays: '268,187,218',
        time: '3:40',
        album: 'Off The Wall',
        image: rockWithYouImage,
      },
      {
        id: 1,
        title: 'Billie Jean',
        plays: '1,040,814,084',
        time: '4:53',
        album: 'Thriller 25',
        image: billieJeanImage, // Use imported image
      },
      {
        id: 2,
        title: 'Beat It',
        plays: '643,786,045',
        time: '4:18',
        album: 'Thriller 25',
        image: beatItImage,
      },
      {
        id: 3,
        title: 'Smooth Criminal',
        plays: '407,234,004',
        time: '4:17',
        album: 'Thriller 25',
        image: smoothCriminalImage,
      },
      {
        id: 4,
        title: "Don't Stop 'Til You Get Enough",
        plays: '316,391,952',
        time: '6:05',
        album: 'Bad 25th Anniversary',
        image: dontStopImage,
      },
      {
        id: 5,
        title: 'Rock With You',
        plays: '268,187,218',
        time: '3:40',
        album: 'Off The Wall',
        image: rockWithYouImage,
      },
  ];

  return (
    <table className="song-table">
      <thead>
        <tr>
          <th>#</th>
          <th>Image</th>
          <th>Title</th>
          <th>Playing</th>
          <th>Time</th>
          <th>Album</th>
        </tr>
      </thead>
      <tbody>
        {songs.map((song, index) => (
          <tr key={song.id} onClick={() => onSongClick(song)}>
            <td>{index + 1}</td>
            <td>
              <img
                src={song.image}
                alt={song.title}
                style={{
                  width: '50px',
                  height: '50px',
                  borderRadius: '5px',
                  objectFit: 'cover',
                }}
              />
            </td>
            <td>{song.title}</td>
            <td>{song.plays}</td>
            <td>{song.time}</td>
            <td>{song.album}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default SongTable;
